INSERT INTO `zh_spiderinfo` VALUES (2, '拒绝「干饭一时爽，洗碗忙一场」——洗碗机挑选攻略', '/special/1419627503204323329', 'https://pic4.zhimg.com/100/v2-7db42c51f4e996ddf658c61a5c25548f_hd.png', '不论是大家庭亦或是小两口，都曾「干饭一时爽，洗碗忙一场」，洗碗这件事可大可小，处理不好可能会引发家庭矛盾。「洗碗机」，这款能提升家居幸福感的电器，能够维系家庭合睦，加码精致家居生活，让我们一起走进拥有洗碗机的家居生活看看吧～', 0, '2021-09-14 16:12:14', '2021-09-14 16:12:14', NULL);
INSERT INTO `zh_spiderinfo` VALUES (3, '抗衰做的好，状态差不了！', '/special/1419620371297931264', 'https://pic2.zhimg.com/100/v2-3c7a002551adb56edc89119042ea20ed_hd.png', '抗衰是护肤界永恒热门话题，抗衰的方法千千万，到底哪一种适合你？到底几岁开始抗衰？抗衰到底指的是什么？@知乎美妆 制作的本期专题给你详解。', 0, '2021-09-14 16:12:14', '2021-09-14 16:12:14', NULL);
INSERT INTO `zh_spiderinfo` VALUES (4, '与新生活来电', '/special/1419617316958654464', 'https://pic3.zhimg.com/100/v2-b558fd32464408823f8ebd4f195c613e_hd.png', '京东电器，焕新你的生活！智能舒适的宅家生活；硬核潮酷的数码黑科技；新品集结一应俱全，体验全面升级。在京东小魔方，探索一切 #与新生活来电# 的可能性。', 0, '2021-09-14 16:12:14', '2021-09-14 16:12:14', NULL);
INSERT INTO `zh_spiderinfo` VALUES (5, '叹为观「知」：走进 2021 世界机器人大会', '/special/1419391243478941696', 'https://pic1.zhimg.com/100/v2-d2bb09e95c4658ed697ea0dc2c3e1c34_hd.png', '这是一场机器人领域规模最大、规格最高、国际元素最丰富的顶级盛会，是机器人的王国，是机器人爱好者的乐园，全面展示机器人领域新技术、新产品、新模式、新业态。2021 世界机器人大会举办之际，工信微报联合知乎发起叹为观「知」行动，邀请知乎答主现场探访，分享知识、经验和见解，欢迎关注～', 0, '2021-09-14 16:12:14', '2021-09-14 16:12:14', NULL);
INSERT INTO `zh_spiderinfo` VALUES (6, '「茶」觉七彩云南', '/special/1419334153960009728', 'https://pic3.zhimg.com/100/v2-8359611712e7e5b469d63dcc9a243a9e_hd.png', '从唐代煎茶、宋代点茶、明代泡茶，到当下茶饮的全民化，你对茶叶了解多少？怎样才能买到真的好茶？又有哪些茶是值得珍藏的？', 0, '2021-09-14 16:12:14', '2021-09-14 16:12:14', NULL);
INSERT INTO `zh_spiderinfo` VALUES (7, '日常「真香」电器 解析指南', '/special/1419264522045116416', 'https://pic3.zhimg.com/100/v2-04d8154139a61c9c5fa4b8945507cdbe_hd.png', '电器与我们的日常生活密不可分，穿梭在大街小巷，难免会有五花八门的电器让我们「乱花渐欲迷人眼」，可也总会有一些「佼佼者」，让我们不禁感叹「嗯真香」。对于这些自带「香味」的电器，究竟有哪些特异功能呢？今日份，让我们走进真香电器系列，查收「闭眼入」硬核指南，下一个「无敌带货王」可能就是你！', 0, '2021-12-23 06:40:58', '2021-12-23 06:40:58', '{\"77\": \"1\", \"add\": true, \"wxchat\": \"码农\", \"cellphone\": \"1\"}');
INSERT INTO `zh_spiderinfo` VALUES (8, '新品情报局 | 科沃斯全能新品', '/special/1419257321579573249', 'https://pic4.zhimg.com/100/v2-e10f5a119bda312396736fe1d2b009db_hd.png', '据爆料，科沃斯堪称「地表全能基站」的跨时代新品将于 9 月 15 日正式发布。极简主义设计、行动宛若无人驾驶、超前时代的人工智能操控……更多新品爆料、购机福利，新品情报局带你一览无余。', 0, '2021-09-14 16:12:14', '2021-09-14 16:12:14', NULL);
INSERT INTO `zh_spiderinfo` VALUES (31, '笨巧果丨知乎城市周刊—九月刊 ', '/special/1421153668409880576', 'https://pic4.zhimg.com/100/v2-5391f055da224dcb9d5a9068404954d7_hd.png', '「笨巧果」，一份为天津城市生活定制的「轻松理性向」专题周刊。收录城市热议话题，邀请优秀答主进行讨论。「笨巧果」周刊，带你了解天津的那些事儿。 ', 0, '2021-09-14 22:12:04', '2021-09-14 22:12:04', NULL);
INSERT INTO `zh_spiderinfo` VALUES (32, '从油开始，美味零负担', '/special/1420756456509960192', 'https://pic2.zhimg.com/100/v2-332094960d2e12835a687ec44b4a0f65_hd.png', '食用油在日常生活中扮演了重要角色，让食物色香味美，增添丰富营养，一日三餐煎炒烹炸样样都离不开它。但注重饮食健康的当代人少不了对「油脂摄入」的关注，因油脂带来的「反式脂肪酸」一直是影响人体健康的关键危害，所以更健康潮流的饮食方式，应该从选好一款食用油开始。这一次金龙鱼携「零反式脂肪食用油」在知乎带来了更多的健康解答，和大家一起，从油开始享受美味零负担。', 0, '2021-09-14 22:12:04', '2021-09-14 22:12:04', NULL);
INSERT INTO `zh_spiderinfo` VALUES (33, '天黑请闭眼，周德东老师请上线', '/special/1420747897398382592', 'https://pic2.zhimg.com/100/v2-b39992563de70e18a218b349c29bb94d_hd.png', '周德东新专栏《周德东讲真：最不真实的真实事件》上线，记录了十二个最不真实的真实故事，你信了吗？ 你们有没有遇到过稀奇古怪的故事？有没有细思极恐的经历？有没有一瞬间感觉世界出了 BUG ? 参与活动，三句话讲出你的故事，周德东老师已经为你准备了一份「细思极恐」的礼物。', 0, '2021-12-23 06:42:19', '2021-12-23 06:42:19', '{\"77\": \"1\", \"add\": true, \"wxchat\": \"码农\", \"cellphone\": \"1\"}');
